import React from 'react';
import './ViewerPopup.css';

const ViewerPopup = ({ viewers, onClose, position }) => {
    return (
        <div className="viewer-popup-overlay" onClick={onClose}>
            <div
                className="viewer-popup"
                style={{ top: position.top, left: position.left }} // Set position dynamically
                onClick={(e) => e.stopPropagation()}
            >
                <h4>Viewed by:</h4>
                <ul>
                    {viewers.map(viewer => (
                        <li key={viewer.id}>{viewer.username}</li>
                    ))}
                </ul>
                <button className="close-popup-btn" onClick={onClose}>Close</button>
            </div>
        </div>
    );
};

export default ViewerPopup;
